// Combine them all into one regex for faster comparison
let regexes = [
	// Flags consisting of two regional indicators (a-z)
	//    [   tag latin chars   ]
		/([\uD83C][\uDDE6-\uDDFF]){2}/g,
	// Subdivision flags
	//   [  black flag  ] [   tag latin chars   ]  [  cancel tag  ]
		/[\uD83C][\uDFF4]([\uDB40][\uDC61-\uDC7A])+[\uDB40][\uDC7F]/g
];
globalThis.cfe_regexGeneralFlag = new RegExp(regexes.map(r => `(${r.source})`).join("|"), "g");

// ChatGPT actually did something correct for once
globalThis.cfe_utf32HexToUtf16 = function (hex32){
	hex32 = parseInt(hex32, 16);

	let highSurrogate = Math.floor((hex32 - 0x10000) / 0x400) + 0xD800;
	let lowSurrogate = ((hex32 - 0x10000) % 0x400) + 0xDC00;

	return String.fromCharCode(highSurrogate) + String.fromCharCode(lowSurrogate);
}

globalThis.cfe_utf16ToUtf32Hex = function (utf16Chars){
	// Takes two characters in Utf16 and converts them to the hex representation in Utf32
	let highSurrogate = (utf16Chars.charCodeAt(0));
	let lowSurrogate = (utf16Chars.charCodeAt(1));

	// https://en.wikipedia.org/wiki/UTF-16
	let final = ((highSurrogate - 0xD800) * 0x400) + (lowSurrogate - 0xDC00) + 0x10000;
	return final.toString(16);
}

globalThis.cfe_replaceAllAsync = async function (string, regex, matchFunction){
	let promises = [];

	string.replace(regex, match => {
		promises.push(matchFunction(match));
	});

	return await Promise.all(promises)
		.then((results) => {
			return string.replace(regex, () => results.shift());
		});
}

function getAllParentNodes(node){
	let parents = [node];
	while (node.parentNode){
		parents.push(node.parentNode);
		node = node.parentNode;
	}
	return parents;
}

let ignoredTagNames = ["SCRIPT", "STYLE", "TITLE", "TEXTAREA", "META", "BASE", "HEAD", "LINK"];

globalThis.cfe_ignoreNode = function (node){
	let parents = getAllParentNodes(node);
	return parents.some(v => (
		// Ignore non-text tags
		ignoredTagNames.includes(v.tagName) ||
		// If content is in any way editable, don't add images (it will break the editor)
		v.isContentEditable
	));
}
